 */

/**
 * Returns the current `RenderTarget` allowing components to apply different behaviors depending on the environment.
 *
 * @remarks
 * ```jsx
 * function App() {
 *   if (RenderTarget.current() === RenderTarget.thumbnail) {
 *     return <PreviewIcon />
 *   }
 *   return <Frame>...</Frame>
 * }
 * ```
 *
 */

/**
